import java.io.ByteArrayOutputStream;
import java.io.File;
import java.io.FileNotFoundException;
import java.io.IOException;
import javax.imageio.stream.FileImageInputStream;
import org.apache.commons.codec.binary.Base64;

import dealType.util.common.Constants;
import dealType.util.common.StringUtil;
import dealType.util.security.sm4.Sm4Utils;

public class Image2Byte {
	public static byte[] image2Bytes(String imagePath) {
		byte[] data = null;

		FileImageInputStream  input =null;
		ByteArrayOutputStream outPut = null;

		try {
			input = new FileImageInputStream(new File(imagePath)); 
			outPut = new ByteArrayOutputStream();
			byte[] buf = new byte[1024];
			int numBytesRead = 0;

			while ((numBytesRead = input.read(buf)) != -1)
				outPut.write(buf, 0, numBytesRead);
			data = outPut.toByteArray();
			outPut.close(); input.close();
		}
		catch(FileNotFoundException e) {
			e.printStackTrace(System.out);
		}
		catch (IOException e) {
			e.printStackTrace(System.out);
		}
			
		return data; 
	}
	public static void main(String[] args) {
		byte[] info = Image2Byte.image2Bytes("C:\\Users\\SiQiWang\\Desktop\\5G.png");
		
		//System.out.println(info.length);
		
		String encode = null;
		
		String enc_key_pic = "1234567890123456ABCDEFABCDEFABCD";

		// 获取人脸对称密钥字节流
		byte key [] = StringUtil.hexStringToByte(enc_key_pic);

		// 使用SM4加密 （padding 方式PAD_PKCS7）
		byte[] result = Sm4Utils.sm4CbcEncrypt(key, info, Constants.PAD_PKCS7);

		// base64编码	
		encode = Base64.encodeBase64String(result);
		
		String s = "";
		
	//	String s = "";
		
		if (s.equals(encode))
			System.out.println("相同");
		else
			System.out.println("不同");
		
		//System.out.println(encode);

		//System.out.println(StringUtil.byte2HexStr(result));
	}
}
